import React from 'react';
import Bittap from '../../assets/bittap_logo_v2.svg';

//output logo
const BittapLogo = () => (
    <img src={Bittap} className="bittap_logo" alt="bittap_logo" title="bittap_logo"/>
);

export default BittapLogo;
